import axios from 'axios';

export async function getUser(param) {
    let response
    try {
        param.includes('@') ?  response = await axios.get(`/user/email:${param}`)
        : response = await axios.get(`/user/name:${param}`)  
        console.log(response);
    } catch (error) {
        console.error(error);
    }
}
